    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    position:fixed;
    top:0;
    left:0;
    width:100%;
    height:100%;

    @media (min-width: 1200px) {
      display: none;
    }
`
const MobileSite = () =>{
    return(
        // <>
